      idade: 22,
    }
  ]
  const pessoa = pessoasLista.map(pessoa => <p>Eu sou o {pessoasLista.nome} e tenho {pessoasLista.idade} anos.</p>)
  return ( 
    <div></div>
  );
}

export default ToDos;
